import React, { useState } from 'react';
import { Container, Typography, Card, CardContent, Button, Select, MenuItem, FormControl, InputLabel, Grid, IconButton } from '@mui/material';
import { useNavigate } from 'react-router-dom';
import MenuIcon from '@mui/icons-material/Menu';
import ExitToAppIcon from '@mui/icons-material/ExitToApp';
import FooterMenu from '../Footer.jsx'; // Import FooterMenu component
import './Team.css'; // Import the CSS file

const Team = () => {
  const navigate = useNavigate(); // Hook to navigate between pages
  const [teamData, setTeamData] = useState({
    registeredMembers: 0,
    validMembers: 0,
    teamIncome: 0.00,
    cumulativeTeamSize: 0,
    generations: [
      {
        percentage: 18,
        teamCommission: 0,
        registeredMembers: 0,
        validMembers: 0,
        teamIncome: 0.00,
      },
      {
        percentage: 6,
        teamCommission: 0,
        registeredMembers: 0,
        validMembers: 0,
        teamIncome: 0.00,
      },
      {
        percentage: 3,
        teamCommission: 0,
        registeredMembers: 0,
        validMembers: 0,
        teamIncome: 0.00,
      },
    ],
  });

  const [filter, setFilter] = useState('All');
  const [menuOpen, setMenuOpen] = useState(false);

  const handleFilterChange = (event) => {
    setFilter(event.target.value);
  };

  const handleViewTeamList = () => {
    navigate('/team-list');
  };

  const toggleMenu = () => {
    setMenuOpen(!menuOpen);
  };

  const logout = () => {
    // Implement logout functionality here
  };

  return (
    <div className="general-container">
      <div className={`general-content ${menuOpen ? 'expanded' : ''}`}>
        {/* Header with Burger Icon and Logout Button */}
        <div className="header">
          <div className="header-left">
            <IconButton onClick={toggleMenu}>
              <MenuIcon />
            </IconButton>
          </div>
          <div className="header-right">
            <button className="logout-btn" onClick={logout}>
              <ExitToAppIcon />
              Logout
            </button>
          </div>
        </div>

        {/* Main Content */}
        <Container maxWidth="lg" className="page-content">
          <Typography variant="h4" className="page-title">
            My Team
          </Typography>

          {/* Filter Section */}
          <Grid container spacing={0} justifyContent="space-between" className="filter-section" style={{ marginBottom: '40px' }}>
          <Typography variant="h5" className="page-title">
            My Team Overview
          </Typography>
            <Grid item xs={12} sm={6} md={4}>
              <FormControl fullWidth variant="outlined">
                <InputLabel>Filter</InputLabel>
                <Select value={filter} onChange={handleFilterChange} label="Filter">
                  <MenuItem value="All">All</MenuItem>
                  <MenuItem value="Last 3 Days">Last 3 Days</MenuItem>
                  <MenuItem value="This Week">This Week</MenuItem>
                  <MenuItem value="This Month">This Month</MenuItem>
                  <MenuItem value="Cancel">Cancel</MenuItem>
                </Select>
              </FormControl>
            </Grid>
          </Grid>

          {/* Team Data Overview */}
          <Grid container spacing={3} className="overview-grid" style={{ marginTop: '20px' }}>
            <Grid item xs={12}>
              <Card className="overview-card">
                <CardContent>
                  <Grid container spacing={3} justifyContent="space-between">
                    <Grid item xs={12} sm={4}>
                      <Typography variant="h6" className="overview-title">Registered Members</Typography>
                      <Typography variant="body1">{teamData.registeredMembers}</Typography>
                    </Grid>
                    <Grid item xs={12} sm={4}>
                      <Typography variant="h6" className="overview-title">Valid Members</Typography>
                      <Typography variant="body1">{teamData.validMembers}</Typography>
                    </Grid>
                    <Grid item xs={12} sm={4}>
                      <Typography variant="h6" className="overview-title">Team Income</Typography>
                      <Typography variant="body1">${teamData.teamIncome.toFixed(2)}</Typography>
                    </Grid>
                  </Grid>
                </CardContent>

          {/* Cumulative Team Size and View Team List */}
          <Grid container spacing={3} justifyContent="space-between" className="filter-section" style={{ marginBottom: '40px' }}>
            <Grid item xs={12} sm={6} md={8}>
              <Typography variant="h6" className="overview-title">Cumulative Team Size</Typography>
              <Typography variant="body1">{teamData.cumulativeTeamSize}</Typography>
            </Grid>
            <Grid item xs={12} sm={6} md={4}>
              <Button
                variant="contained"
                color="primary"
                fullWidth
                onClick={handleViewTeamList}
              >
                View Team List
              </Button>
            </Grid>
          </Grid>
          </Card>
            </Grid>
          </Grid>
          {/* Generations Data (Horizontal Cards) */}
          <Typography variant="h6" className="page-title" style={{ marginTop: '40px' }}>
            The Last Three Generations of Data
          </Typography>
          <Grid container spacing={3} className="generations-container">
            {teamData.generations.map((generation, index) => (
              <Grid item xs={12} sm={4} key={index}>
                <Card className="generation-card">
                  <CardContent>
                    <Typography variant="h6">{`Generation ${index + 1}`}</Typography>
                    <Typography variant="body1">Percentage: {generation.percentage}%</Typography>
                    <Typography variant="body1">Team Commission: ${generation.teamCommission}</Typography>
                    <Typography variant="body1">Registered Members: {generation.registeredMembers}</Typography>
                    <Typography variant="body1">Valid Members: {generation.validMembers}</Typography>
                    <Typography variant="body1">Team Income: ${generation.teamIncome.toFixed(2)}</Typography>
                  </CardContent>
                </Card>
              </Grid>
            ))}
          </Grid>
        </Container>
      </div>

      {/* Footer */}
      <FooterMenu />
    </div>
  );
};

export default Team;
